import React from 'react';
import Navbar from './components/navbar';
import './App.css';
import Footer from './components/footer';
import Sidebar from './components/sidebar/sidebar';

function App() {
	return (
		<div className="App" style={{ height: '100%' }}>


			<Navbar />
<Sidebar/>
			<Footer />
		</div>
	);
}

export default App;
